const HomeCards = ({ navigation }) => {
  const isBn = useSelector((state) => state.isBn);
  const isDark = useSelector((state) => state.isDark);
  const colors = new AppColors(isDark);
  const textColor = colors.getTextColor();

  const cards = [
    {
      title: isBn ? "কোচিং" : "Coaching",
      subtitle: isBn
        ? "কমিটি অ্যাকাউন্ট এর মাধ্যমে প্রফেশনাল ভাবে কোচিং সেন্টার পরিচালনা করুন"
        : "Optimize coaching center management with a comity account.",
      bgColor: "#0079BE",
      icon: svg1,
    },
    {
      title: isBn ? "ভাড়া" : "Rent",
      subtitle: isBn
        ? "বাড়িভাড়া অথবা যেকোনো ভাড়া এবং ভাড়াটিয়াদের পরিচালনা করুন"
        : "Manage house rentals or any rentals and tenants",
      bgColor: "#009C22",
      icon: svg2,
    },
    {
      title: isBn ? "সমাজ" : "Society",
      subtitle: isBn
        ? "সমাজ বা নিজের এলাকা পরিচালনা করুন খুব সহজে"
        : "Manage the society or your area very easily",
      bgColor: "#537EB8",
      icon: svg3,
    },
    {
      title: isBn ? "অন্যকিছু" : "Other",
      subtitle: isBn
        ? "সমিতি, সংস্থা, ইভেন্ট, পিকনিক, ভ্রমণ, খেলাধুলা যাইহোক না কেন সব কিছুর পেমেন্ট এবং পরিচালনা করুন"
        : "Manage payments for organization, union, events, picnics, Tour, sports, and more.",
      bgColor: "#D61D6B",
      icon: svg4,
    },
  ];
  return (
    <View
      style={{
        marginHorizontal: 20,
        paddingVertical: 8,
      }}
    >
      <Text style={[mainStyle.headLine, { color: textColor }]}>
        {isBn
          ? "ফ্রিতে নিচে থেকে এখনই নিজের পছন্দমত বিজনেস অ্যাকাউন্ট খুলুন"
          : "Start organizing your comity efficiently by opening a business account that suits your needs."}
      </Text>
      <View
        style={{
          gap: 20,
        }}
      >
        {cards.map((card, i) => (
          <TouchableOpacity
            onPress={() => navigation.navigate("CreateCommittee")}
            key={i}
          >
            <View
              style={{
                padding: 12,
                backgroundColor: card.bgColor,
                borderRadius: 10,
                justifyContent: "space-between",
                alignItems: "center",
                flexDirection: "row",
                gap: 8,
              }}
            >
              <View style={{ flex: 1 }}>
                <Text
                  style={{
                    color: "white",
                    fontSize: 20,
                    fontWeight: "700",
                    marginVertical: 8,
                  }}
                >
                  {card.title}
                </Text>
                <Text style={[mainStyle.text14, { color: "white" }]}>
                  {card.subtitle}
                </Text>
              </View>
              <View
                style={{
                  justifyContent: "flex-end",
                  flexDirection: "row",
                }}
              >
                <SvgXml xml={card.icon} />
              </View>
            </View>
          </TouchableOpacity>
        ))}
      </View>
    </View>
  );
};

export default HomeCards;
